import React, { Component } from 'react'
class test extends Component {
  constructor(props) {
    super(props);
    this.state = {
      str: "sssss"
    }
  }
  handleChange () {
    let a = this.state.str
    this.setState({
      str: a.split('').reverse().join('')
    })
  }
  componentDidMount () {

  }
  render () {
    const { str } = this.state
    return (
      <div onClick={this.handleChange()}>
        {str}
      </div>
    );
  }
}
export default test;
